    "Identification, documentation and delineation of coastal migratory bird habitat
    in Alaska. II, Feeding habits of birds in the Beaufort Sea: Partial final report",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:50.409122",nt"name": "identification-documentation-and-delineation-of-coastal-migratory-bird-habitat-in-alaska-i-de357",nt"isopen":
    false,nt"url": null,nt"notes": "The impact of oil and gas development on
    bird populations is usually thought of in terms of spilled oil directly oiling birds
    and causing mortality. Far more important, however, may be the physical and chemical
    changes that will occur in any environment that may disrupt the trophic system that
    supports the birds. An example of such impacts includes the chronic low level fuel
    spills associated with human that could cause mortality of prey organisms. Summaries
    of the prey items found in each species of bird are presented in Tables 1 through
    12. Table 13 summarizes Tables 1 through 12. No information on Red Phalaropes (Phalaropus
    fuliaarius) is presented. All stomachs of this species contained what was classed
    as invertebrate chyme. Further analysis of these specimens has to be done by specialists
    familiar with all the body parts of the prey organisms.",nt"license_title":
